import Foundation

extension String {
    func idnaMap() -> String {
        let scalars = self.unicodeScalars.flatMap { (scalar) -> [ UnicodeScalar ] in
            scalar.mapTo() ?? [ scalar ]
        }
        var output = ""
        output.unicodeScalars.append(contentsOf: scalars)
        return output
    }
}

